"@import "../../style/themes/default";
@import "../../style/mixins/index";
@import "../../input/style/mixin";

@select-prefix-cls: ~"@{ant-prefix}-select";

.selection__clear() {
  display: inline-block;
  font-style: normal;
  vertical-align: baseline;
  text-align: center;
  text-transform: none;
  text-rendering: auto;
  opacity: 0;
  position: absolute;
  right: 8px;
  z-index: 1;
  background: @component-background;
  top: 50%;
  font-size: @font-size-base;
  color: @disabled-color;
  width: 12px;
  height: 12px;
  margin-top: -6px;
  line-height: 12px;
  cursor: pointer;
  transition: color 0.3s ease, opacity 0.15s ease;
  &:before {
    display: block;
    .iconfont-font("\e62e");
  }
  &:hover {
    color: @text-color-secondary;
  }
}

.@{select-prefix-cls} {
  box-sizing: border-box;
  display: inline-block;
  position: relative;
  color: @text-color;
  font-size: @font-size-base;

  > ul > li > a {
    padding: 0;
    background-color: @component-background;
  }

  // arrow
  &-arrow {
    .iconfont-mixin();
    position: absolute;
    top: 50%;
    right: 8px;
    line-height: 1;
    margin-top: -6px;
    .iconfont-size-under-12px(9px);

    * {
      display: none;
    }

    &:before {
      content: '\e61d';
      transition: transform 0.2s ease;
    }
  }

  &-selection {
    outline: none;
    user-select: none;

    box-sizing: border-box;
    display: block;

    background-color: @component-background;
    border-radius: @border-radius-base;
    border: @border-width-base @border-style-base @border-color-base;
    transition: all .3s @ease-in-out;

    &:hover {
      .hover;
    }

    .@{select-prefix-cls}-focused &,
    &:focus,
    &:active {
      .active;
    }

    &__clear {
      .selection__clear();
    }

    &:hover &__clear {
      opacity: 1;
    }

    &-selected-value {
      float: left;
      overflow: hidden;
      text-overflow: ellipsis;
      white-space: nowrap;
      max-width: 100%;
      padding-right: 14px;
    }
  }

  &-disabled {
    color: @disabled-color;
  }

  &-disabled &-selection {
    background: @input-disabled-bg;
    cursor: not-allowed;
    &:hover,
    &:focus,
    &:active {
      border-color: @border-color-base;
      box-shadow: none;
    }

    &__clear {
      display: none;
      visibility: hidden;
      pointer-events: none;
    }
  }

  &-disabled &-selection--multiple &-selection__choice {
    background: @background-color-active;
    color: #aaa;
    padding-right: 10px;
    &__remove {
      display: none;
    }
  }

  &-selection--single {
    height: @input-height-base;
    position: relative;
    cursor: pointer;
  }

  &-selection__rendered {
    display: block;
    margin-left: 7px;
    margin-right: 7px;
    position: relative;
    line-height: @input-height-base - 2px;
    // https://github.com/ant-design/ant-design/issues/3481#issuecomment-254721026
    &:after {
      content: '.';
      visibility: hidden;
      pointer-events: none;
      display: inline-block;
      width: 0;
    }
  }

  &-lg {
    .@{select-prefix-cls}-selection--single {
      height: @input-height-lg;
    }
    .@{select-prefix-cls}-selection__rendered {
      line-height: @input-height-lg - 2px;
    }
    .@{select-prefix-cls}-selection--multiple {
      min-height: @input-height-lg;
      .@{select-prefix-cls}-selection__rendered {
        li {
          height: @input-height-lg - 8px;
          line-height: @input-height-lg - 8px;
        }
      }
      .@{select-prefix-cls}-selection__clear {
        top: @input-height-lg / 2;
      }
    }
  }

  &-sm {
    .@{select-prefix-cls}-selection--single {
      height: @input-height-sm;
    }
    .@{select-prefix-cls}-selection__rendered {
      line-height: @input-height-sm - 2px;
    }
    .@{select-prefix-cls}-selection--multiple {
      min-height: @input-height-sm;
      .@{select-prefix-cls}-selection__rendered {
        li {
          height: @input-height-sm - 8px;
          line-height: @input-height-sm - 8px;
        }
      }
      .@{select-prefix-cls}-selection__clear {
        top: @input-height-sm / 2;
      }
    }
  }

  &-disabled &-selection__choice__remove {
    color: @disabled-color;
    cursor: default;
    &:hover {
      color: @disabled-color;
    }
  }

  &-search__field__wrap {
    display: inline-block;
    position: relative;
  }

  &-selection__placeholder,
  &-search__field__placeholder { // for TreeSelect compatibility
    position: absolute;
    top: 50%;
    left: 0;
    right: 9px;
    color: @input-placeholder-color;
    line-height: 20px;
    height: 20px;
    max-width: 100%;
    margin-top: -10px;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
    text-align: left;
  }

  &-search__field__placeholder {
    left: 8px;
  }

  &-search--inline {
    position: absolute;
    height: 100%;
    width: 100%;

    .@{select-prefix-cls}-selection--multiple & {
      float: left;
      position: static;
    }

    .@{select-prefix-cls}-search__field__wrap {
      width: 100%;
      height: 100%;
    }

    .@{select-prefix-cls}-search__field {
      border-width: 0;
      font-size: 100%;
      height: 100%;
      width: 100%;
      background: transparent;
      outline: 0;
      border-radius: @border-radius-base;
    }

    .@{select-prefix-cls}-search__field__mirror {
      position: absolute;
      top: 0;
      left: -9999px;
      white-space: pre;
      pointer-events: none;
    }

    > i {
      float: right;
    }
  }

  &-selection--multiple {
    min-height: @input-height-base;
    cursor: text;
    padding-bottom: 3px;
    .clearfix;

    .@{select-prefix-cls}-search--inline {
      width: auto;
      padding: 0;
      max-width: 100%;
      .@{select-prefix-cls}-search__field {
        max-width: 100%;
        width: 0.75em;
      }
    }

    .@{select-prefix-cls}-selection__rendered {
      margin-left: 5px;
      margin-bottom: -3px;
      height: auto;
    }

    > ul > li,
    .@{select-prefix-cls}-selection__rendered > ul > li {  // for tree-select
      margin-top: 3px;
      height: @input-height-base - 8px;
      line-height: @input-height-base - 8px;
    }

    .@{select-prefix-cls}-selection__choice {
      color: @tag-default-color;
      background-color: @tag-default-bg;
      border-radius: 4px;
      cursor: default;
      float: left;
      margin-right: 4px;
      max-width: 99%;
      position: relative;
      overflow: hidden;
      transition: padding .3s @ease-in-out;
      padding: 0 20px 0 10px;
      &__disabled {
        padding: 0 10px;
      }
    }

    .@{select-prefix-cls}-selection__choice__content {
      display: inline-block;
      white-space: nowrap;
      overflow: hidden;
      text-overflow: ellipsis;
      max-width: 100%;
      transition: margin .3s @ease-in-out;
    }

    .@{select-prefix-cls}-selection__choice__remove {
      .iconfont-mixin();
      color: @text-color-secondary;
      line-height: inherit;
      cursor: pointer;
      display: inline-block;
      font-weight: bold;
      transition: all 0.3s @ease-in-out;
      .iconfont-size-under-12px(8px);
      position: absolute;
      right: 4px;
      padding: 0 0 0 8px;
      &:hover {
        color: #404040;
      }
      &:before {
        content: "\e633";
      }
    }

    .@{select-prefix-cls}-selection__clear {
      top: @input-height-base / 2;
    }
  }

  &-allow-clear &-selection--multiple &-selection__rendered {
    margin-right: 20px; // In case that clear button will overlap content
  }

  &-open {
    .@{select-prefix-cls}-arrow {
      .ie-rotate(2);
      -ms-transform: rotate(180deg);
      &:before {
        transform: rotate(180deg);
      }
    }
    .@{select-prefix-cls}-selection {
      .active();
    }
  }

  &-combobox {
    .@{select-prefix-cls}-arrow {
      display: none;
    }
    .@{select-prefix-cls}-search--inline {
      height: 100%;
      width: 100%;
      float: none;
    }
    .@{select-prefix-cls}-search__field__wrap {
      width: 100%;
      height: 100%;
    }
    .@{select-prefix-cls}-search__field {
      width: 100%;
      height: 100%;
      position: relative;
      z-index: 1;
      transition: all .3s @ease-in-out;
      box-shadow: none;
    }
  }
  &-combobox&-allow-clear &-selection:hover &-selection__rendered {
    margin-right: 20px; // In case that clear button will overlap content
  }
}

.@{select-prefix-cls}-dropdown {
  &.slide-up-enter.slide-up-enter-active&-placement-bottomLeft,
  &.slide-up-appear.slide-up-appear-active&-placement-bottomLeft {
    animation-name: antSlideUpIn;
  }

  &.slide-up-enter.slide-up-enter-active&-placement-topLeft,
  &.slide-up-appear.slide-up-appear-active&-placement-topLeft {
    animation-name: antSlideDownIn;
  }

  &.slide-up-leave.slide-up-leave-active&-placement-bottomLeft {
    animation-name: antSlideUpOut;
  }

  &.slide-up-leave.slide-up-leave-active&-placement-topLeft {
    animation-name: antSlideDownOut;
  }

  &-hidden {
    display: none;
  }

  background-color: @component-background;
  box-shadow: @box-shadow-base;
  border-radius: @border-radius-base;
  box-sizing: border-box;
  z-index: @zindex-dropdown;
  left: -9999px;
  top: -9999px;
  position: absolute;
  outline: none;
  overflow: hidden;
  font-size: @font-size-base;

  &-menu {
    outline: none;
    margin-bottom: 0;
    padding-left: 0; // Override default ul/ol
    list-style: none;
    max-height: 250px;
    overflow: auto;

    &-item-group-list {
      margin: 0;
      padding: 0;

      > .@{select-prefix-cls}-dropdown-menu-item {
        padding-left: 16px;
      }
    }

    &-item-group-title {
      color: @text-color-secondary;
      line-height: 1.5;
      padding: 8px;
    }

    &-item {
      position: relative;
      display: block;
      padding: 7px 8px;
      font-weight: normal;
      color: @text-color;
      white-space: nowrap;
      cursor: pointer;
      overflow: hidden;
      transition: background 0.3s ease;

      &:hover {
        background-color: @item-hover-bg;
      }

      &-disabled {
        color: @disabled-color;
        cursor: not-allowed;

        &:hover {
          color: @disabled-color;
          background-color: @component-background;
          cursor: not-allowed;
        }
      }

      &-selected {
        &,
        &:hover {
          background-color: @background-color-base;
          font-weight: 600;
          color: @text-color;
        }
      }

      &-active {
        background-color: @item-active-bg;
      }

      &-divider {
        height: 1px;
        margin: 1px 0;
        overflow: hidden;
        background-color: #e5e5e5;
        line-height: 0;
      }
    }
  }

  &&--multiple {
    .@{select-prefix-cls}-dropdown-menu-item {
      &:after {
        .iconfont-font("\e632");
        color: transparent;
        .iconfont-size-under-12px(10px);
        transition: all 0.2s ease;
        position: absolute;
        top: 50%;
        transform: translateY(-50%);
        right: 8px;
        font-weight: bold;
        text-shadow: 0 0.1px 0, 0.1px 0 0, 0 -0.1px 0, -0.1px 0;
      }

      &:hover:after {
        color: #ddd;
      }

      &-disabled:after {
        display: none;
      }

      &-selected:after,
      &-selected:hover:after {
        color: @primary-color;
        display: inline-block;
      }
    }
  }

  &-container-open,
  &-open {
    .@{select-prefix-cls}-dropdown {
      display: block;
    }
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@slider-prefix-cls: ~"@{ant-prefix}-slider";
// slider color
@slider-disabled-color: @disabled-color;
// tooltip
@slider-tooltip-color: #fff;
@slider-tooltip-bg: tint(@text-color, 4%);
@slider-tooltip-arrow-width: 4px;
@slider-tooltip-distance: @slider-tooltip-arrow-width + 4px;
@slider-tooltip-arrow-color: @slider-tooltip-bg;

.@{slider-prefix-cls} {
  position: relative;
  margin: 10px 6px;
  padding: 4px 0;
  height: 12px;
  cursor: pointer;

  .vertical();

  &-with-marks {
    margin-bottom: 28px;
  }

  &-rail {
    position: absolute;
    width: 100%;
    height: 4px;
    border-radius: 2px;
    background-color: @border-color-split;
    transition: background-color 0.3s ease;
  }

  &-track {
    position: absolute;
    height: 4px;
    border-radius: @border-radius-base;
    background-color: tint(@primary-color, 60%);
    transition: background-color 0.3s ease;
  }

  &-handle {
    position: absolute;
    margin-left: -7px;
    margin-top: -5px;
    width: 14px;
    height: 14px;
    cursor: pointer;
    border-radius: 50%;
    border: solid 2px tint(@primary-color, 50%);
    background-color: @component-background;
    transition: border-color 0.3s ease, transform .3s cubic-bezier(0.18, 0.89, 0.32, 1.28);

    &:hover {
      border-color: @primary-5;
      transform: scale(1.2);
      transform-origin: center center;
    }

    &:active {
      box-shadow: 0 0 0 2px fadeout(@primary-color, 80%);
    }
  }

  &:hover {
    .@{slider-prefix-cls}-rail {
      background-color: #e1e1e1;
    }
    .@{slider-prefix-cls}-track {
      background-color: tint(@primary-color, 40%);
    }
    .@{slider-prefix-cls}-handle {
      border-color: @primary-5;
    }
  }

  &-mark {
    position: absolute;
    top: 14px;
    left: 0;
    width: 100%;
    font-size: @font-size-base;
  }

  &-mark-text {
    position: absolute;
    display: inline-block;
    vertical-align: middle;
    text-align: center;
    cursor: pointer;
    color: @text-color-secondary;

    &-active {
      color: @text-color;
    }
  }

  &-step {
    position: absolute;
    width: 100%;
    height: 4px;
    background: transparent;
  }

  &-dot {
    position: absolute;
    top: -2px;
    margin-left: -4px;
    width: 8px;
    height: 8px;
    border: 2px solid @border-color-split;
    background-color: @component-background;
    cursor: pointer;
    border-radius: 50%;
    vertical-align: middle;
    &:first-child {
      margin-left: -4px;
    }
    &:last-child {
      margin-left: -4px;
    }
    &-active {
      border-color: tint(@primary-color, 50%);
    }
  }

  &-disabled {
    cursor: not-allowed;

    .@{slider-prefix-cls}-track {
      background-color: @slider-disabled-color !important;
    }

    .@{slider-prefix-cls}-handle,
    .@{slider-prefix-cls}-dot {
      border-color: @slider-disabled-color !important;
      background-color: @component-background;
      cursor: not-allowed;
      box-shadow: none;
    }

    .@{slider-prefix-cls}-mark-text,
    .@{slider-prefix-cls}-dot {
      cursor: not-allowed !important;
    }
  }
}

.vertical() {
  &-vertical {
    width: 12px;
    height: 100%;
    margin: 6px 10px;
    padding: 0 4px;

    .@{slider-prefix-cls}-rail {
      height: 100%;
      width: 4px;
    }

    .@{slider-prefix-cls}-track {
      width: 4px;
    }

    .@{slider-prefix-cls}-handle {
      margin-left: -5px;
      margin-bottom: -7px;
    }

    .@{slider-prefix-cls}-mark {
      top: 0;
      left: 12px;
      width: 18px;
      height: 100%;
    }

    .@{slider-prefix-cls}-mark-text {
      left: 4px;
      white-space: nowrap;
    }

    .@{slider-prefix-cls}-step {
      width: 4px;
      height: 100%;
    }

    .@{slider-prefix-cls}-dot {
      top: auto;
      left: 2px;
      margin-bottom: -4px;
    }
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@spin-prefix-cls: ~"@{ant-prefix}-spin";
@spin-dot-default: @text-color-secondary;

.@{spin-prefix-cls} {
  color: @primary-color;
  vertical-align: middle;
  text-align: center;
  opacity: 0;
  position: absolute;
  transition: transform 0.3s @ease-in-out-circ;
  font-size: @font-size-base;
  display: none;

  &-spinning {
    opacity: 1;
    position: static;
    display: inline-block;
  }

  &-nested-loading {
    position: relative;
  }

  &-nested-loading {
    > div > .@{spin-prefix-cls} {
      position: absolute;
      height: 100%;
      max-height: 320px;
      width: 100%;
      z-index: 4;
      .@{spin-prefix-cls}-dot {
        position: absolute;
        top: 50%;
        left: 50%;
        margin: -@spin-dot-size / 2;
      }
      .@{spin-prefix-cls}-text {
        position: absolute;
        top: 50%;
        width: 100%;
        padding-top: (@spin-dot-size - @font-size-base) / 2 + 2px;
      }
      &.@{spin-prefix-cls}-show-text .@{spin-prefix-cls}-dot {
        margin-top: -@spin-dot-size / 2 - 10px;
      }
    }

    > div > .@{spin-prefix-cls}-sm {
      .@{spin-prefix-cls}-dot {
        margin: -@spin-dot-size-sm / 2;
      }
      .@{spin-prefix-cls}-text {
        padding-top: (@spin-dot-size-sm - @font-size-base) / 2 + 2px;
      }
      &.@{spin-prefix-cls}-show-text .@{spin-prefix-cls}-dot {
        margin-top: -@spin-dot-size-sm / 2 - 10px;
      }
    }

    > div > .@{spin-prefix-cls}-lg {
      .@{spin-prefix-cls}-dot {
        margin: -@spin-dot-size-lg / 2;
      }
      .@{spin-prefix-cls}-text {
        padding-top: (@spin-dot-size-lg - @font-size-base) / 2 + 2px;
      }
      &.@{spin-prefix-cls}-show-text .@{spin-prefix-cls}-dot {
        margin-top: -@spin-dot-size-lg / 2 - 10px;
      }
    }
  }

  &-container {
    transition: all 0.3s @ease-in-out;
    position: relative;
  }

  &-blur {
    overflow: hidden;
    opacity: 0.7;
    -webkit-filter: blur(0.5px);
    filter: blur(0.5px);

    /* autoprefixer: off */
    filter: ~"progid\:DXImageTransform\.Microsoft\.Blur(PixelRadius\=1, MakeShadow\=false)";
    /* autoprefixer: on */
    // workround for a strange style bug in safari:
    // https://github.com/ant-design/ant-design/issues/4622
    // have no clue why this works
    -webkit-transform: translateZ(0);
    &:after {
      content: '';
      position: absolute;
      left: 0;
      right: 0;
      top: 0;
      bottom: 0;
      background: #fff;
      opacity: 0.3;
      transition: all .3s;
      z-index: 10;
    }
  }

  // tip
  // ------------------------------
  &-tip {
    color: @spin-dot-default;
  }

  // dots
  // ------------------------------

  &-dot {
    position: relative;
    display: inline-block;
    .square(@spin-dot-size);
    transform: rotate(45deg);
    animation: antRotate 1.2s infinite linear;
    i {
      width: 9px;
      height: 9px;
      border-radius: 100%;
      background-color: @primary-color;
      transform: scale(0.75);
      display: block;
      position: absolute;
      opacity: 0.3;
      animation: antSpinMove 1s infinite linear alternate;
      transform-origin: 50% 50%;
      &:nth-child(1) {
        left: 0;
        top: 0;
      }
      &:nth-child(2) {
        right: 0;
        top: 0;
        animation-delay: 0.4s;
      }
      &:nth-child(3) {
        right: 0;
        bottom: 0;
        animation-delay: 0.8s;
      }
      &:nth-child(4) {
        left: 0;
        bottom: 0;
        animation-delay: 1.2s;
      }
    }
  }

  // Sizes
  // ------------------------------
  // small
  &-sm &-dot {
    .square(@spin-dot-size-sm);
    i {
      width: 6px;
      height: 6px;
    }
  }

  // large
  &-lg &-dot {
    .square(@spin-dot-size-lg);
    i {
      width: 14px;
      height: 14px;
    }
  }

  &&-show-text &-text {
    display: block;
  }
}

@media all and (-ms-high-contrast: none), (-ms-high-contrast: active) {
  /* IE10+ */
  .@{spin-prefix-cls}-blur {
    background: @component-background;
    opacity: 0.5;
  }
}

@keyframes antSpinMove {
  to {
    opacity: 1;
  }
}

@keyframes antRotate {
  to {
    transform: rotate(405deg);
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@steps-prefix-cls: ~"@{ant-prefix}-steps";
@process-icon-color: @primary-color;
@process-title-color: @text-color;
@process-description-color: @process-title-color;
@process-tail-color: @border-color-split;
@process-icon-text-color: #fff;
@wait-icon-color: @disabled-color;
@wait-title-color: @text-color-secondary;
@wait-description-color: @wait-title-color;
@wait-tail-color: @process-tail-color;
@finish-icon-color: @process-icon-color;
@finish-title-color: @wait-title-color;
@finish-description-color: @finish-title-color;
@finish-tail-color: @process-icon-color;
@error-icon-color: @error-color;
@error-title-color: @error-color;
@error-description-color: @error-color;
@error-tail-color: @error-color;
@steps-background: @component-background;

@steps-icon-size: 26px;
@steps-small-icon-size: 18px;
@steps-dot-size: 5px;
@steps-current-dot-size: 7px;
@steps-desciption-max-width: 120px;

.@{steps-prefix-cls} {
  font-size: 0;
  line-height: @line-height-base;
  .@{steps-prefix-cls}-item {
    position: relative;
    display: inline-block;
    vertical-align: top;

    &.@{steps-prefix-cls}-status-wait {
      .@{steps-prefix-cls}-head-inner {
        border-color: @wait-icon-color;
        background-color: @steps-background;
        > .@{steps-prefix-cls}-icon {
          color: @wait-icon-color;
          .@{steps-prefix-cls}-icon-dot {
            background: @wait-icon-color;
          }
        }
      }
      .@{steps-prefix-cls}-title {
        color: @wait-title-color;
      }
      .@{steps-prefix-cls}-description {
        color: @wait-description-color;
      }
      .@{steps-prefix-cls}-tail > i {
        background-color: @wait-tail-color;
      }
    }
    &.@{steps-prefix-cls}-status-process {
      .@{steps-prefix-cls}-head-inner {
        border-color: @process-icon-color;
        background-color: @process-icon-color;
        > .@{steps-prefix-cls}-icon {
          color: @process-icon-text-color;
          .@{steps-prefix-cls}-icon-dot {
            background: @process-icon-color;
          }
        }
      }
      .@{steps-prefix-cls}-title {
        color: @process-title-color;
      }
      .@{steps-prefix-cls}-description {
        color: @process-description-color;
      }
      .@{steps-prefix-cls}-tail > i {
        background-color: @process-tail-color;
      }
    }
    &.@{steps-prefix-cls}-status-finish {
      .@{steps-prefix-cls}-head-inner {
        border-color: @finish-icon-color;
        background-color: @steps-background;
        > .@{steps-prefix-cls}-icon {
          color: @finish-icon-color;
          .@{steps-prefix-cls}-icon-dot {
            background: @finish-icon-color;
          }
        }
      }
      .@{steps-prefix-cls}-tail > i:after {
        width: 100%;
        background: @finish-tail-color;
        transition: all .6s;
        opacity: 1;
        box-shadow: 0 0 0 0 @primary-color;
        animation: tailEffect .4s;
      }
      .@{steps-prefix-cls}-title {
        color: @finish-title-color;
      }
      .@{steps-prefix-cls}-description {
        color: @finish-description-color;
      }
    }

    &.@{steps-prefix-cls}-status-error {
      .@{steps-prefix-cls}-head-inner {
        border-color: @error-icon-color;
        background-color: @steps-background;
        > .@{steps-prefix-cls}-icon {
          color: @error-icon-color;
          .@{steps-prefix-cls}-icon-dot {
            background: @error-icon-color;
          }
        }
      }
      .@{steps-prefix-cls}-title {
        color: @error-title-color;
      }
      .@{steps-prefix-cls}-description {
        color: @error-description-color;
      }
      .@{steps-prefix-cls}-tail > i {
        background-color: @process-tail-color;
      }
    }

    &.@{steps-prefix-cls}-next-error {
      .@{steps-prefix-cls}-tail > i,
      .@{steps-prefix-cls}-tail > i:after {
        background-color: @error-tail-color;
      }
    }

    &.@{steps-prefix-cls}-custom {
      .@{steps-prefix-cls}-head-inner {
        background: none;
        border: 0;
        width: auto;
        height: auto;
        > .@{steps-prefix-cls}-icon {
          font-size: @steps-icon-size;
          width: @steps-icon-size;
          height: @steps-icon-size;
        }
      }
      &.@{steps-prefix-cls}-status-process {
        .@{steps-prefix-cls}-head-inner > .@{steps-prefix-cls}-icon {
          color: @process-icon-color;
        }
      }
    }
  }

  .@{steps-prefix-cls}-head,
  .@{steps-prefix-cls}-main {
    position: relative;
    display: inline-block;
    vertical-align: top;
  }
  .@{steps-prefix-cls}-head {
    background: @steps-background;
  }

  .@{steps-prefix-cls}-head-inner {
    display: block;
    border: @border-width-base @border-style-base @wait-icon-color;
    width: @steps-icon-size;
    height: @steps-icon-size;
    line-height: 23px;
    text-align: center;
    border-radius: @steps-icon-size;
    font-size: @font-size-lg;
    margin-right: 8px;
    transition: background-color 0.3s ease, border-color 0.3s ease;
    font-family: @font-family-no-number;

    > .@{steps-prefix-cls}-icon {
      line-height: 1;
      color: @primary-color;
      position: relative;
      &.@{iconfont-css-prefix} {
        font-size: @font-size-base;
        &-cross,
        &-check {
          font-weight: bold;
        }
      }
    }
  }
  .@{steps-prefix-cls}-title {
    font-size: @font-size-lg;
    line-height: @steps-icon-size;
    color: @text-color;
    font-weight: bold;
    background-color: @steps-background;
    display: inline-block;
    padding-right: 10px;
    > a:first-child:last-child {
      color: @text-color;
    }
  }
  .@{steps-prefix-cls}-item:last-child {
    .@{steps-prefix-cls}-title {
      padding-right: 0;
      width: 100%;
    }
    .@{steps-prefix-cls}-tail {
      display: none;
    }
  }
  .@{steps-prefix-cls}-description {
    font-size: @font-size-base;
    color: @text-color-secondary;
  }
  .@{steps-prefix-cls}-tail {
    position: absolute;
    left: 0;
    width: 100%;
    top: 13px;
    padding: 0 10px;
    > i {
      display: inline-block;
      vertical-align: top;
      background: @wait-tail-color;
      height: 1px;
      border-radius: 1px;
      width: 100%;
      position: relative;
      &:after {
        position: absolute;
        content: '';
        top: 0;
        width: 0;
        background: @border-color-split;
        height: 100%;
        opacity: 0;
      }
    }
  }

  &.@{steps-prefix-cls}-small {
    .@{steps-prefix-cls}-head-inner {
      border: @border-width-base @border-style-base @wait-icon-color;
      width: @steps-small-icon-size;
      height: @steps-small-icon-size;
      line-height: 15px;
      text-align: center;
      border-radius: @steps-small-icon-size;
      font-size: @font-size-base;
      margin-right: 10px;
      > .@{steps-prefix-cls}-icon.@{iconfont-css-prefix} {
        .iconfont-size-under-12px(9px);
        top: 0;
      }
    }
    .@{steps-prefix-cls}-main {
      margin-top: 0;
    }
    .@{steps-prefix-cls}-title {
      font-size: @font-size-base;
      line-height: @steps-small-icon-size;
      color: @text-color;
      font-weight: bold;
    }
    .@{steps-prefix-cls}-description {
      font-size: @font-size-base;
      color: @text-color-secondary;
    }
    .@{steps-prefix-cls}-tail {
      top: 8px;
      padding: 0 8px;
      > i {
        height: 1px;
        border-radius: 1px;
        width: 100%;
      }
    }
    .@{steps-prefix-cls}-custom .@{steps-prefix-cls}-head-inner > .@{steps-prefix-cls}-icon {
      font-size: @steps-small-icon-size;
      width: @steps-small-icon-size;
      height: @steps-small-icon-size;
    }
  }
}

.@{steps-prefix-cls}-vertical {
  > .@{steps-prefix-cls}-item {
    display: block;
  }

  > .@{steps-prefix-cls}-item > .@{steps-prefix-cls}-tail {
    position: absolute;
    left: 13px;
    top: 0;
    height: 100%;
    width: 1px;
    padding: 30px 0 4px;
    > i {
      height: 100%;
      width: 1px;
      &:after {
        height: 0;
        width: 100%;
      }
    }
  }

  .@{steps-prefix-cls}-status-finish {
    .@{steps-prefix-cls}-tail > i:after {
      height: 100%;
    }
  }

  .@{steps-prefix-cls}-head {
    float: left;
    &-inner {
      margin-right: 16px;
    }
  }

  .@{steps-prefix-cls}-main {
    min-height: 47px;
    overflow: hidden;
    display: block;
    .@{steps-prefix-cls}-title {
      line-height: @steps-icon-size;
    }
    .@{steps-prefix-cls}-description {
      padding-bottom: 12px;
    }
  }
}

.@{steps-prefix-cls}-vertical.@{steps-prefix-cls}-small {
  .@{steps-prefix-cls}-tail {
    position: absolute;
    left: 9px;
    top: 0;
    padding: 22px 0 4px;
    > i {
      height: 100%;
    }
  }

  .@{steps-prefix-cls}-title {
    line-height: @steps-small-icon-size;
  }
}

.@{steps-prefix-cls}-horizontal {
   &.@{steps-prefix-cls}-hidden {
     visibility: hidden;
  }
  .@{steps-prefix-cls}-description {
    max-width: @steps-desciption-max-width;
  }
  .@{steps-prefix-cls}-item:not(:first-child) .@{steps-prefix-cls}-head {
    padding-left: 10px;
    margin-left: -10px;
  }
}

.@{steps-prefix-cls}-dot {
  .@{steps-prefix-cls}-item {
    .@{steps-prefix-cls}-step {
      display: inline-block;
      text-align: center;
      width: @steps-desciption-max-width;
    }
    &:not(:first-child) .@{steps-prefix-cls}-head {
      margin-left: 0;
      padding-left: 0;
    }
  }
  .@{steps-prefix-cls}-tail {
    margin: 0 0 0 @steps-desciption-max-width / 2;
    padding: 0;
    width: 100%;
    top: 1px;

    & > i {
      height: 3px;
    }
  }
  .@{steps-prefix-cls}-head {
    display: inline-block;
    padding-right: 0;
    &-inner {
      margin: 0 auto;
      width: @steps-dot-size;
      height: @steps-dot-size;
      line-height: @steps-dot-size;
      border: 0;

      .@{steps-prefix-cls}-icon-dot {
        float: left;
        width: 100%;
        height: 100%;
        border-radius: @steps-dot-size / 2;
        position: relative;
        &:after {
          content: '';
          background: rgba(255, 255, 255, 0.001);
          width: 40px;
          height: 24px;
          position: absolute;
          top: -8px;
          left: -16px;
        }
        &:hover {
          transform: scale(1.3);
        }
      }
    }
  }
  .@{steps-prefix-cls}-main {
    display: block;
    margin-top: 10px;
    .@{steps-prefix-cls}-title {
      padding-right: 0;
      background-color: transparent;
    }
  }
  .@{steps-prefix-cls}-status-process {
    .@{steps-prefix-cls}-head {
      top: -1px;
      &-inner {
        width: @steps-current-dot-size;
        height: @steps-current-dot-size;
        line-height: @steps-current-dot-size;

        .@{steps-prefix-cls}-icon-dot {
          border-radius: @steps-current-dot-size / 2;
        }
      }
    }
  }
  &.@{steps-prefix-cls}-vertical {
    .@{steps-prefix-cls}-tail {
      left: 2px;
      height: 100%;
      padding: 0;
      top: 15px;
      > i {
        height: 100%;
        width: 3px;
      }
    }
    .@{steps-prefix-cls}-head {
      top: 12px;
      left: 1px;
    }
    .@{steps-prefix-cls}-status-process {
      .@{steps-prefix-cls}-head {
        left: 0;
      }
    }
  }
}

@keyframes tailEffect {
  to {
    box-shadow: 0 0 3px 3px transparent;
  }
}
