"@import "../../style/themes/default";
@import "../../style/mixins/index";

@table-prefix-cls: ~"@{ant-prefix}-table";

.@{table-prefix-cls}-wrapper {
  .clearfix;
}

.@{table-prefix-cls} {
  font-size: @font-size-base;
  color: @text-color;
  overflow: hidden;
  position: relative;
  border-radius: @border-radius-base @border-radius-base 0 0;

  &-body {
    transition: opacity 0.3s ease;
  }

  table {
    width: 100%;
    border-collapse: separate;
    border-spacing: 0;
    text-align: left;
    border-radius: @border-radius-base @border-radius-base 0 0;
    overflow: hidden;
  }

  &-thead > tr > th {
    background: @table-header-bg;
    font-weight: 500;
    transition: background .3s ease;
    text-align: left;
    color: @heading-color;

    &[colspan] {
      text-align: center;
    }

    .@{iconfont-css-prefix}-filter, .@{table-prefix-cls}-filter-icon {
      position: relative;
      margin-left: 4px;
      font-size: @font-size-base;
      cursor: pointer;
      color: #999;
      transition: all .3s;
      width: 14px;

      &:hover {
        color: @text-color;
      }

      &:after {
        content: '';
        position: absolute;
        width: 14px;
        height: 50px;
        left: 0;
        top: -19px;
      }
    }

    .@{table-prefix-cls}-filter-selected.@{iconfont-css-prefix}-filter {
      color: @primary-color;
    }
  }

  &-tbody > tr > td {
    border-bottom: @border-width-base @border-style-base @border-color-split;
    transition: all .3s;
    // height placeholder for empty cell
    &:empty:after {
      content: '.';
      visibility: hidden;
    }
  }

  &-thead > tr,
  &-tbody > tr {
    transition: all .3s;
    &.@{table-prefix-cls}-row-hover,
    &:hover {
      & > td {
        background: @table-row-hover-bg;
      }
    }
  }

  &-thead > tr:hover {
    background: none;
  }

  &-footer {
    padding: @table-padding-vertical @table-padding-horizontal;
    background: @table-header-bg;
    border-radius: 0 0 @border-radius-base @border-radius-base;
    position: relative;
    &:before {
      content: '';
      height: 1px;
      background: @table-header-bg;
      position: absolute;
      top: -1px;
      width: 100%;
      left: 0;
    }
  }

  &.@{table-prefix-cls}-bordered &-footer {
    border: @border-width-base @border-style-base @border-color-split;
  }

  &-title {
    padding: @table-padding-vertical 0;
    position: relative;
    top: 1px;
    border-radius: @border-radius-base @border-radius-base 0 0;
  }

  &.@{table-prefix-cls}-bordered &-title {
    border: @border-width-base @border-style-base @border-color-split;
    padding-left: @table-padding-horizontal;
    padding-right: @table-padding-horizontal;
  }

  &-title + &-content {
    position: relative;
    border-radius: @border-radius-base @border-radius-base 0 0;
    overflow: hidden;
    .@{table-prefix-cls}-bordered & {
      &,
      table {
        border-radius: 0;
      }
    }
  }

  // https://github.com/ant-design/ant-design/issues/4373
  &-without-column-header &-title + &-content,
  &-without-column-header table {
    border-radius: 0;
  }

  &-tbody > tr.@{table-prefix-cls}-row-selected {
    background: @table-selected-row-bg;
  }

  &-thead > tr > th.@{table-prefix-cls}-column-sort {
    background: @table-header-sort-bg;
  }

  &-thead > tr > th,
  &-tbody > tr > td {
    padding: @table-padding-vertical @table-padding-horizontal;
    word-break: break-all;
  }

  &-thead > tr > th.@{table-prefix-cls}-selection-column-custom {
    padding-left: 16px;
    padding-right: 0;
  }

  &-thead > tr > th.@{table-prefix-cls}-selection-column,
  &-tbody > tr > td.@{table-prefix-cls}-selection-column {
    text-align: center;
    min-width: 62px;
    width: 62px;
  }

  &-expand-icon-th,
  &-row-expand-icon-cell {
    text-align: center;
    min-width: 50px;
    width: 50px;
  }

  &-header {
    background: @table-header-bg;
    overflow: hidden;
  }

  &-header table {
    border-radius: @border-radius-base @border-radius-base 0 0;
  }

  &-loading {
    position: relative;
    .@{table-prefix-cls}-body {
      background: @component-background;
      opacity: 0.5;
    }
    .@{table-prefix-cls}-spin-holder {
      height: 20px;
      line-height: 20px;
      left: 50%;
      top: 50%;
      margin-left: -30px;
      position: absolute;
    }
    .@{table-prefix-cls}-with-pagination {
      margin-top: -20px;
    }
    .@{table-prefix-cls}-without-pagination {
      margin-top: 10px;
    }
  }

  &-middle {
    .@{table-prefix-cls}-thead > tr > th:not(.@{table-prefix-cls}-selection-column),
    .@{table-prefix-cls}-tbody > tr > td {
      padding: 10px 8px;
    }

    .@{table-prefix-cls}-title,
    .@{table-prefix-cls}-footer {
      padding: 10px 8px;
    }

    .@{table-prefix-cls}-column-sorter-up:after {
      top: -13px;
      height: 13px;
    }

    .@{table-prefix-cls}-column-sorter-down:after {
      bottom: -11px;
      height: 13px;
    }

    .@{table-prefix-cls}-thead > tr > th {
      .@{iconfont-css-prefix}-filter,
      .@{table-prefix-cls}-filter-icon {
        &:after {
