"@import "../../style/themes/default";
@import "../../style/mixins/index";
@tab-prefix-cls: ~"@{ant-prefix}-tabs";

@import "./card-style";

.@{tab-prefix-cls} {
  box-sizing: border-box;
  position: relative;
  overflow: hidden;
  .clearfix;
  color: @text-color;

  &-ink-bar {
    z-index: 1;
    position: absolute;
    left: 0;
    bottom: 1px;
    box-sizing: border-box;
    height: 2px;
    background-color: @primary-color;
    transform-origin: 0 0;
  }

  &-bar {
    border-bottom: @border-width-base @border-style-base @border-color-base;
    margin-bottom: 16px;
    outline: none;
    transition: padding .3s @ease-in-out;
  }

  &-nav-container {
    overflow: hidden;
    font-size: @tabs-title-font-size;
    line-height: @line-height-base;
    box-sizing: border-box;
    position: relative;
    white-space: nowrap;
    margin-bottom: -1px;
    transition: padding .3s @ease-in-out;
    .clearfix;

    &-scrolling {
      padding-left: 32px;
      padding-right: 32px;
    }
  }

  &-tab-prev,
  &-tab-next {
    user-select: none;
    z-index: 2;
    width: 0;
    height: 100%;
    line-height: 32px;
    cursor: pointer;
    border: 0;
    background-color: transparent;
    position: absolute;
    text-align: center;
    color: @text-color-secondary;
    transition: width .3s @ease-in-out, opacity .3s @ease-in-out, color .3s @ease-in-out;
    opacity: 0;
    pointer-events: none;

    &.@{tab-prefix-cls}-tab-arrow-show {
      opacity: 1;
      width: 32px;
      height: 100%;
      pointer-events: auto;
    }

    &:hover {
      color: @text-color;
    }

    &-icon {
      font-style: normal;
      font-weight: bold;
      font-variant: normal;
      line-height: inherit;
      vertical-align: baseline;
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      text-align: center;
      text-transform: none;

      &:before {
        display: block;
        font-family: "anticon" !important;
        .iconfont-size-under-12px(10px);
      }
    }
  }

  &-tab-btn-disabled {
    cursor: not-allowed;
    &,
    &:hover {
      color: @disabled-color;
    }
  }

  &-tab-next {
    right: 2px;

    &-icon:before {
      content: "\e61f";
    }
  }

  &-tab-prev {
    left: 0;
    &-icon:before {
      content: "\e620";
    }
    :root & {
      filter: none;
    }
  }

  &-nav-wrap {
    overflow: hidden;
    margin-bottom: -1px;
  }

  &-nav-scroll {
    overflow: hidden;
    white-space: nowrap;
  }

  &-nav {
    box-sizing: border-box;
    padding-left: 0;
    transition: transform 0.3s @ease-in-out;
    position: relative;
    margin: 0;
    list-style: none;
    display: inline-block;

    &:before,
    &:after {
      display: table;
      content: " ";
    }

    &:after {
      clear: both;
    }

    .@{tab-prefix-cls}-tab-disabled {
      pointer-events: none;
      cursor: default;
      color: @disabled-color;
    }

    .@{tab-prefix-cls}-tab {
      display: inline-block;
      height: 100%;
      margin-right: 24px;
      box-sizing: border-box;
      position: relative;

      &:last-child {
        margin-right: 0;
      }

      padding: 8px 20px;
      transition: color 0.3s @ease-in-out;
      cursor: pointer;
      text-decoration: none;

      &:hover {
        color: @primary-5;
      }

      &:active {
        color: @primary-7;
      }
      .@{iconfont-css-prefix} {
        width: 14px;
        height: 14px;
        margin-right: 8px;
      }
    }

    .@{tab-prefix-cls}-tab-active {
      color: @primary-color;
    }
  }

  &-mini &-nav-container {
    font-size: @font-size-base;
  }

  &-mini &-tab {
    margin-right: 0;
    padding: 8px 16px;
  }

  &:not(&-vertical) {
    > .@{tab-prefix-cls}-content {
      width: 100%;

      > .@{tab-prefix-cls}-tabpane {
        flex-shrink: 0;
        width: 100%;
        transition: opacity .45s;
        opacity: 1;
      }

      > .@{tab-prefix-cls}-tabpane-inactive {
        opacity: 0;
        height: 0;
        padding: 0 !important;
        pointer-events: none;
      }
    }
    > .@{tab-prefix-cls}-content-animated {
      display: flex;
      flex-direction: row;
      will-change: margin-left;
      transition: margin-left 0.3s @ease-in-out;
    }
  }

  &-vertical {
    > .@{tab-prefix-cls}-bar {
      border-bottom: 0;
      height: 100%;
      &-tab-prev, &-tab-next {
        width: 32px;
        height: 0;
        transition: height .3s @ease-in-out, opacity .3s @ease-in-out, color .3s @ease-in-out;
      }
      &-tab-prev.@{tab-prefix-cls}-tab-arrow-show,
      &-tab-next.@{tab-prefix-cls}-tab-arrow-show {
        width: 100%;
        height: 32px;
      }

      .@{tab-prefix-cls}-tab {
        float: none;
        margin-right: 0;
        margin-bottom: 16px;
        display: block;
        padding: 8px 24px;

        &:last-child {
          margin-bottom: 0;
        }
      }

      .@{tab-prefix-cls}-extra-content {
        text-align: center;
      }

      .@{tab-prefix-cls}-nav-scroll {
        width: auto;
      }

      .@{tab-prefix-cls}-nav-container,
      .@{tab-prefix-cls}-nav-wrap {
        height: 100%;
      }

      .@{tab-prefix-cls}-nav-container {
        margin-bottom: 0;

        &.@{tab-prefix-cls}-nav-container-scrolling {
          padding: 32px 0;
        }
      }

      .@{tab-prefix-cls}-nav-wrap {
        margin-bottom: 0;
      }

      .@{tab-prefix-cls}-nav {
        width: 100%;
      }

      .@{tab-prefix-cls}-ink-bar {
        width: 2px;
        left: auto;
        height: auto;
        top: 0;
      }
    }

    > .@{tab-prefix-cls}-content {
      overflow: hidden;
      width: auto;
      margin-top: 0 !important;
    }

    > .@{tab-prefix-cls}-bar {
      .@{tab-prefix-cls}-tab-next {
        width: 100%;
        bottom: 0;
        height: 32px;
        &-icon:before {
          content: "\e61d";
        }
      }

      .@{tab-prefix-cls}-tab-prev {
        top: 0;
        width: 100%;
        height: 32px;
        &-icon:before {
          content: "\e61e";
        }
      }
    }
  }

  &-vertical&-left {
    > .@{tab-prefix-cls}-bar {
      float: left;
      border-right: @border-width-base @border-style-base @border-color-split;
      margin-right: -1px;
      margin-bottom: 0;
      .@{tab-prefix-cls}-tab {
        text-align: right;
      }
      .@{tab-prefix-cls}-nav-container {
        margin-right: -1px;
      }
      .@{tab-prefix-cls}-nav-wrap {
        margin-right: -1px;
      }
      .@{tab-prefix-cls}-ink-bar {
        right: 1px;
      }
    }
    > .@{tab-prefix-cls}-content {
      padding-left: 24px;
      border-left: @border-width-base @border-style-base @border-color-split;
    }
  }

  &-vertical&-right {
    > .@{tab-prefix-cls}-bar {
      float: right;
      border-left: @border-width-base @border-style-base @border-color-split;
      margin-left: -1px;
      margin-bottom: 0;
      .@{tab-prefix-cls}-nav-container {
        margin-left: -1px;
      }
      .@{tab-prefix-cls}-nav-wrap {
        margin-left: -1px;
      }
      .@{tab-prefix-cls}-ink-bar {
        left: 1px;
      }
    }
    > .@{tab-prefix-cls}-content {
      padding-right: 24px;
      border-right: @border-width-base @border-style-base @border-color-split;
    }
  }

  &-bottom > &-bar {
    margin-bottom: 0;
    margin-top: 16px;
  }
}

.@{tab-prefix-cls}-top .@{tab-prefix-cls}-ink-bar-animated,
.@{tab-prefix-cls}-bottom .@{tab-prefix-cls}-ink-bar-animated {
  transition: transform .3s @ease-in-out, width .3s @ease-in-out;
}

.@{tab-prefix-cls}-left .@{tab-prefix-cls}-ink-bar-animated,
.@{tab-prefix-cls}-right .@{tab-prefix-cls}-ink-bar-animated {
  transition: transform .3s @ease-in-out, height .3s @ease-in-out;
}

.no-flex,
.@{tab-prefix-cls}-no-animation,
.@{tab-prefix-cls}-vertical {
  > .@{tab-prefix-cls}-content {
    &-animated {
      transform: none !important;
      margin-left: 0 !important;
    }
    > .@{tab-prefix-cls}-tabpane-inactive {
      display: none;
    }
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@tag-prefix-cls: ~"@{ant-prefix}-tag";

.@{tag-prefix-cls} {
  display: inline-block;
  line-height: 20px;
  height: 22px;
  padding: 0 8px;
  border-radius: @border-radius-base;
  border: @border-width-base @border-style-base @border-color-split;
  background: @tag-default-bg;
  font-size: @tag-font-size;
  transition: all 0.3s @ease-out;
  opacity: 1;
  margin-right: 8px;
  cursor: pointer;
  white-space: nowrap;

  &:hover {
    opacity: 0.85;
  }

  &,
  a,
  a:hover {
    color: @tag-default-color;
  }

  &-text {
    a:first-child:last-child {
      display: inline-block;
      margin: 0 -8px;
      padding: 0 8px;
    }
  }

  .@{iconfont-css-prefix}-cross {
    .iconfont-size-under-12px(10px);
    cursor: pointer;
    font-weight: bold;
    margin-left: 3px;
    transition: all 0.3s @ease-out;
    opacity: 0.66;

    &:hover {
      opacity: 1;
    }
  }

  &-has-color {
    border-color: transparent;
    &,
    a,
    a:hover,
    .@{iconfont-css-prefix}-cross,
    .@{iconfont-css-prefix}-cross:hover {
      color: #fff;
    }
  }

  &-checkable {
    background-color: transparent;
    border-color: transparent;
    &:not(&-checked):hover {
      color: @primary-color;
    }
    &:active,
    &-checked {
      color: #fff;
    }
    &-checked {
      background-color: @primary-6;
    }
    &:active {
      background-color: @primary-7;
    }
  }

  &-close {
    width: 0 !important;
    padding: 0;
    margin: 0;
  }

  &-zoom-enter,
  &-zoom-appear {
    animation: antFadeIn .2s @ease-in-out-circ;
    animation-fill-mode: both;
  }

  &-zoom-leave {
    animation: antZoomOut .3s @ease-in-out-circ;
    animation-fill-mode: both;
  }

  @colors: pink, red, orange, yellow, cyan, green, blue, purple;

  // mixin to iterate over colors and create CSS class for each one
  .make-color-classes(@i: length(@colors)) when (@i > 0) {
    .make-color-classes(@i - 1);
    @color: extract(@colors, @i);
    @lightColor: "@{color}-2";
    @darkColor: "@{color}-6";
    &-@{color} {
      color: @@darkColor;
      background: @@lightColor;
      border-color: @@lightColor;
    }
    &-@{color}-inverse {
      background: @@darkColor;
      border-color: @@darkColor;
      color: #fff;
    }
  }

  .make-color-classes();
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";
@import "../../input/style/mixin";

@timepicker-prefix-cls: ~"@{ant-prefix}-time-picker";

.@{timepicker-prefix-cls}-panel {
  z-index: @zindex-picker;
  position: absolute;

  &-inner {
    position: relative;
    outline: none;
    list-style: none;
    font-size: @font-size-base;
    text-align: left;
    background-color: @component-background;
    border-radius: @border-radius-base;
    box-shadow: @box-shadow-base;
    background-clip: padding-box;
    line-height: 1.5;
    overflow: hidden;
    left: -2px;
  }

  &-input {
    margin: 0;
    padding: 0;
    border: 0;
    width: 100%;
    cursor: auto;
    line-height: 1.5;
    outline: 0;

    .placeholder;

    &-wrap {
      box-sizing: border-box;
      position: relative;
      padding: 6px;
